import React from "react"

class MojProfil extends React.Component{

    constructor(){
        super()
        this.state = {
            user:""
        }
    }

    componentDidMount(){
        var config={
            method: 'get',
            headers: {'Authorization': 'Bearer ' + localStorage.getItem('jwt')}
          };

        fetch('http://localhost:8080/bioskop/users/'+this.props.logedUsername+'/null/null',config)
            .then(res => res.json())
            .then(res => {
                this.setState({
                    user: res
                })
            })
    }

    render(){
        return(
            <div id="mojProfil">
                <h1>Moj profil</h1>
            </div>
        )
    }
}

export default MojProfil
